import React from 'react';
// import './Header.css';

function Header() {
  return (
    <header className="header">
      <div className="header-logo">
        <img src="src/img/logo_SoT.png" alt="Ship of Thesis Logo" />
      </div>
      <div className="header-logo">
        <img src="./img/logo_LY.svg" alt="Linssen Yachts Logo" />
      </div>
    </header>
  );
}

export default Header;
